import React, { useEffect, useState } from 'react';
import api from '../services/api';

function AdminPanel() {
    const [users, setUsers] = useState([]);
    const [courses, setCourses] = useState([]);
    const [articles, setArticles] = useState([]);
    const [subscriptions, setSubscriptions] = useState([]);
    const [subscriptionTypes, setSubscriptionTypes] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    const [newUser, setNewUser] = useState({
        name: '',
        email: '',
        password: '',
        is_active: true,
    });

    const [newCourse, setNewCourse] = useState({
        title: '',
        description: '',
        price: '',
        is_active: false,
        is_subscription_based: false,
    });

    const [newArticle, setNewArticle] = useState({
        title: '',
        content: '',
        course_id: '',
    });

    const [newSubscription, setNewSubscription] = useState({
        user_id: '',
        subscription_type_id: '',
        start_date: '',
        end_date: '',
        status: 'Active',
    });

    useEffect(() => {
        const fetchData = async () => {
            try {
                const [
                    usersRes,
                    coursesRes,
                    articlesRes,
                    subscriptionsRes,
                    subscriptionTypesRes,
                ] = await Promise.all([
                    api.get('/usercus'),
                    api.get('/courses'),
                    api.get('/articles'),
                    api.get('/subscriptions'),
                    api.get('/subscription-types'),
                ]);
                setUsers(usersRes.data);
                setCourses(coursesRes.data);
                setArticles(articlesRes.data);
                setSubscriptions(subscriptionsRes.data);
                setSubscriptionTypes(subscriptionTypesRes.data);
            } catch (err) {
                setError('Failed to load admin data');
            } finally {
                setLoading(false);
            }
        };

        fetchData();
    }, []);

    const handleCreateEntity = async (apiMethod, data, setState, resetState) => {
        try {
            const response = await apiMethod(data);
            setState((prev) => [...prev, response.data]);
            if (resetState) resetState();
        } catch (err) {
            alert('Failed to create entity.');
        }
    };

    const handleDeleteEntity = async (apiMethod, id, setState) => {
        try {
            await apiMethod(id);
            setState((prev) => prev.filter((item) => item.id !== id));
        } catch (err) {
            alert('Failed to delete entity.');
        }
    };

    if (loading) return <div style={styles.loading}>Loading admin panel...</div>;
    if (error) return <div style={styles.error}>Error: {error}</div>;

    return (
        <div style={styles.container}>
            <h1 style={styles.title}>Admin Panel</h1>

            {/* Users Section */}
            <section style={styles.section}>
                <h2 style={styles.sectionTitle}>Users</h2>
                <form
                    style={styles.form}
                    onSubmit={(e) => {
                        e.preventDefault();
                        handleCreateEntity(api.createUser, newUser, setUsers, () =>
                            setNewUser({ name: '', email: '', password: '', is_active: true })
                        );
                    }}
                >
                    <input
                        style={styles.input}
                        type="text"
                        placeholder="Name"
                        value={newUser.name}
                        onChange={(e) => setNewUser({ ...newUser, name: e.target.value })}
                        required
                    />
                    <input
                        style={styles.input}
                        type="email"
                        placeholder="Email"
                        value={newUser.email}
                        onChange={(e) => setNewUser({ ...newUser, email: e.target.value })}
                        required
                    />
                    <input
                        style={styles.input}
                        type="password"
                        placeholder="Password"
                        value={newUser.password}
                        onChange={(e) => setNewUser({ ...newUser, password: e.target.value })}
                        required
                    />
                    <label style={styles.checkboxLabel}>
                        <input
                            type="checkbox"
                            checked={newUser.is_active}
                            onChange={(e) => setNewUser({ ...newUser, is_active: e.target.checked })}
                        />
                        Active
                    </label>
                    <button style={styles.button} type="submit">
                        Add User
                    </button>
                </form>
                <ul style={styles.list}>
                    {users.map((user) => (
                        <li key={user.id} style={styles.listItem}>
                            {user.name} - {user.email}
                            <button
                                style={styles.deleteButton}
                                onClick={() =>
                                    handleDeleteEntity(api.deleteUser, user.id, setUsers)
                                }
                            >
                                Delete
                            </button>
                        </li>
                    ))}
                </ul>
            </section>

            {/* Courses Section */}
            <section style={styles.section}>
                <h2 style={styles.sectionTitle}>Courses</h2>
                <form
                    style={styles.form}
                    onSubmit={(e) => {
                        e.preventDefault();
                        handleCreateEntity(api.createCourse, newCourse, setCourses, () =>
                            setNewCourse({
                                title: '',
                                description: '',
                                price: '',
                                is_active: false,
                                is_subscription_based: false,
                            })
                        );
                    }}
                >
                    <input
                        style={styles.input}
                        type="text"
                        placeholder="Title"
                        value={newCourse.title}
                        onChange={(e) => setNewCourse({ ...newCourse, title: e.target.value })}
                        required
                    />
                    <textarea
                        style={styles.textarea}
                        placeholder="Description"
                        value={newCourse.description}
                        onChange={(e) => setNewCourse({ ...newCourse, description: e.target.value })}
                        required
                    />
                    <input
                        style={styles.input}
                        type="number"
                        placeholder="Price"
                        value={newCourse.price}
                        onChange={(e) =>
                            setNewCourse({ ...newCourse, price: parseFloat(e.target.value) })
                        }
                        required
                        min="0"
                    />
                    <label style={styles.checkboxLabel}>
                        <input
                            type="checkbox"
                            checked={newCourse.is_active}
                            onChange={(e) =>
                                setNewCourse({ ...newCourse, is_active: e.target.checked })
                            }
                        />
                        Active
                    </label>
                    <label style={styles.checkboxLabel}>
                        <input
                            type="checkbox"
                            checked={newCourse.is_subscription_based}
                            onChange={(e) =>
                                setNewCourse({
                                    ...newCourse,
                                    is_subscription_based: e.target.checked,
                                })
                            }
                        />
                        Subscription Based
                    </label>
                    <button style={styles.button} type="submit">
                        Add Course
                    </button>
                </form>
                <ul style={styles.list}>
                    {courses.map((course) => (
                        <li key={course.id} style={styles.listItem}>
                            {course.title} - ${course.price}
                            <button
                                style={styles.deleteButton}
                                onClick={() =>
                                    handleDeleteEntity(api.deleteCourse, course.id, setCourses)
                                }
                            >
                                Delete
                            </button>
                        </li>
                    ))}
                </ul>
            </section>
        </div>
    );
}

const styles = {
    container: {
        maxWidth: '900px',
        margin: '0 auto',
        padding: '20px',
        fontFamily: 'Arial, sans-serif',
    },
    title: {
        textAlign: 'center',
        marginBottom: '20px',
    },
    section: {
        marginBottom: '40px',
    },
    sectionTitle: {
        marginBottom: '10px',
    },
    form: {
        display: 'flex',
        flexDirection: 'column',
        gap: '10px',
        marginBottom: '20px',
    },
    input: {
        padding: '10px',
        fontSize: '14px',
        border: '1px solid #ccc',
        borderRadius: '4px',
    },
    textarea: {
        padding: '10px',
        fontSize: '14px',
        border: '1px solid #ccc',
        borderRadius: '4px',
        minHeight: '100px',
    },
    checkboxLabel: {
        display: 'flex',
        alignItems: 'center',
        gap: '5px',
    },
    button: {
        padding: '10px 15px',
        fontSize: '14px',
        color: '#fff',
        backgroundColor: '#007BFF',
        border: 'none',
        borderRadius: '4px',
        cursor: 'pointer',
    },
    deleteButton: {
        padding: '5px 10px',
        fontSize: '12px',
        color: '#fff',
        backgroundColor: '#DC3545',
        border: 'none',
        borderRadius: '4px',
        cursor: 'pointer',
        marginLeft: '10px',
    },
    list: {
        listStyle: 'none',
        padding: '0',
    },
    listItem: {
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        padding: '10px',
        borderBottom: '1px solid #ccc',
    },
    loading: {
        textAlign: 'center',
        fontSize: '18px',
        color: '#555',
    },
    error: {
        textAlign: 'center',
        fontSize: '18px',
        color: '#DC3545',
    },
};

export default AdminPanel;
